import React from 'react';
import { auth } from '../../firebase';
import './signoutbutton.css';

const SignOutButton = () => 
	<button className="sing-out-btn" type="button" onClick={auth.doSignOut} > 
		Sign Out
	</button>

export default SignOutButton;
